DROP TABLE `Delivery`;

CREATE TABLE `Delivery` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `delivery_id` varchar(11) default NULL,
  `driver_id` varchar(13) default NULL,
  `vehicle_id` varchar(13) default NULL,
  `delivery_time` varchar(255),
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

